import './App.css';
import { Link, Route, BrowserRouter as Router } from "react-router-dom"

function App() {
  return (
    <Router>
      <Route exact path="/" component={Home} />
      <Route path="/about" component={About} />
      <Route path="/users" component={NotFound} />
    </Router>
  );
}

export default App;
